import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import Cookies from 'js-cookie';

export default function PublicRoutes({
	component: Component,
	restricted,
	...rest
}) {
	const token = Cookies.get('token');
	return (
		<Route
			{...rest}
			render={props =>
				token && restricted ? (
					<Redirect to="/main-page" />
				) : (
					<Component {...props} />
				)
			}
		/>
	);
}
